import React from 'react'
import { CourseConsumer } from "./CourseContext";

export default function Cart() {
    const logout = ()=> {
        localStorage.removeItem("user-data");
    }

    return (
        <div>
            <button onClick={logout}>LogOut</button><h4>Your Cart:</h4>
            <CourseConsumer>
                {(datas) => 
                  (datas.map((data, i)=> {
                   // console.log(data.title);
                    return <div key={i}><h2>{data.title}</h2></div>;
                })) 
                }
            </CourseConsumer>

        </div>
    )
}
